import React from 'react';

export default function AIcenter() {
  return (
    <div style={{padding: "20px"}}>
      <h2>AI分析中心</h2>
      <div style={{
        backgroundColor: "#f1c40f",
        padding: "15px",
        borderRadius: "8px",
        marginTop: "1rem"
      }}>
        实时数据分析图表
      </div>
    </div>
  );
}
